  input: "\"TEXT\",\"F3XN\",\"C00140590\",\"June 20, 2007\t\t    Laura S.  Federal
    Elections Commission    RE:  California Republican Party           FEC ID#  C00140590
    \          June Monthly Report (05/01/07-05/30/07)            Dear Laura S,    The
    transfers shown reflect variations due to timing of transfers based upon reimbursements
    from the non-federal and Levin accounts the federal account at different points
    in the 70-day window provided in Reg. 10-6.7(f)(2).  No transfers were made outside
    the 70-day window.      Our filing software would not allow us to detail information
    pertaining to receipts on Line 15 of our report. The reimbursement from Cobra
    Serv was for a health insurance reimbursement for an ex-employee. The check from
    Strategic Fundraising was a refund for a charge that was never incurred but billed.
    \ The reimbursement form 465 Fairchild Holdings LLC was for a rent deposit. The
    checks from USPS refer to returned postage from direct mail pieces which were
    previously paid with 100% federal dollars.     There were several corrective transfers
    made on this report.  There was an overall Levin over transfer of $3808 dealing
    from 2006. A prior Form 99 filed in May 2007 addressed this issue.    There was
    also a 44,042 transfer for a check which was previously allocated on the H4 but
    which should have been shown as FEA. A copy of that check was sent to the Fec
    in May 2007. There was also a transfer for a previos period voided check in the
    amount of   $276. The  $ 276 and $44,042 were combined on one transfer as of May
    14.    In regard to occupation and employer information requested, a letter is
    sent to those donors whose contributions exceed $200, but did not provide us with
    their employer and occupation on our initial contribution solicitation which sites
    the FEC regulation for the requested information.  The committees policy is to
    send a follow-up letter within thirty days of the original contribution to request
    this information with a pre-addressed envelop enclosed for the return of such
    information.  All such information received is reported accordingly.  If information
    is received after the reporting deadline, the committee will amend the appropriate
    monthly report.      Fred Arjani    \""
